                <div class="u-clearfix u-expanded-width u-gutter-0 u-layout-wrap u-block-292d-3"><div class="u-layout">  <div class="u-layout-row"><div class="u-size-30 u-size-60-md">  <div class="u-layout-col"><div class="u-container-style u-image u-layout-cell u-size-60 u-block-292d-4" data-image-width="650" data-image-height="650"><div class="u-container-layout u-block-292d-5"></div></div>  </div></div>
              <div class="u-size-30 u-size-60-md">  <div class="u-layout-col"><div class="u-size-40">  <div class="u-layout-row"><div class="u-container-style u-layout-cell u-size-60 u-block-292d-6"><div class="u-container-layout u-valign-middle u-block-292d-7"><h2 class="u-text u-text-default u-block-292d-16">QUI sommes - Nous?&nbsp;</h2><p class="u-text u-text-default u-block-292d-17">Le ComparateurAssurance.com est un comparateur d'assurance qui se distingue des autres en étant le premier et unique à être « géolocalisé ». Cela signifie que lorsqu'un utilisateur renseigne sa ville, le comparateur sé​lectionne les agences à proximité pour comparer les offres qu'elles proposent. Il intègre à ses comparatifs les courtiers et agents généraux proches du lieu de résidence de l'internaute, pour l'assurance moto et la mutuelle santé notamment, y compris les plus petites structures. Les comparaisons sont en temps réel, ce qui signifie que toute évolution de tarif de formule d'assurance chez un partenaire est instantanément répercutée dans le comparatif. L'objectif est de faciliter la recherche et la comparaison d'assurances en offrant une vue d'ensemble du marché de l'assurance, ce qui évite de contacter tous les assureurs pour trouver la meilleure offre. En utilisant Le ComparateurAssurance.com, les utilisateurs peuvent comparer les différents contrats ainsi que le détail de leurs garanties sur un seul et même document en ligne, depuis leur domicile.</p></div></div>  </div></div>
